package com.womai.shop.manage.front.impl;import com.womai.shop.manage.ServersManager;import com.womai.shop.manage.front.QuestionnaireService;import com.womai.shop.domain.front.Questionnaire;import com.womai.shop.dao.front.QuestionnaireDao;public class QuestionnaireServiceImpl extends ServersManager<Questionnaire>		implements QuestionnaireService {	private QuestionnaireDao questionnaireDao;	public void setQuestionnaireDao(QuestionnaireDao questionnaireDao) {		this.questionnaireDao = questionnaireDao;	}		/**	 * 新增问卷	 */	@Override	public int insert(Questionnaire e) {		if(e==null){			throw new NullPointerException("e is null");		}						return super.insert(e);	}	/**	 * 修改问卷	 */	@Override	public int update(Questionnaire e) {				return super.update(e);	}}